import React from 'react';

export const CarDetails = ({...data}) => {

  return (
    <div style={{display:'flex', padding:'10px', border:'1px solid black'}}>
        <div style={{border:'1px solid black',width:'50%'}}>
          <h3 style={{textTransform:'capitalize'}}>{data.Name}</h3>
          <img style={{ border:'4px solid #ECECEC',borderRadius:'12px'}} src={data.img_url} alt="Car Image"/>
      </div>
      <div style={{marginLeft:'30px',border:'1px solid black',width:'50%'}}>
            <h3>Details:</h3>
          <h3 style={{textAlign:'center'}}> Name : {data.name}</h3>
      </div>
    </div>
  )
}
